INSERT INTO `services` (`id`, `organization_id`, `program_id`, `name`, `alternate_name`, `description`, `url`, `email`, `status`, `interpretation_services`, `application_process`, `wait_time`, `fees`, `accreditations`, `licenses`) VALUES
('1000', '254', '', 'CUNY Start', '', 'Academic support for CUNY students. // CUNY students can get help meeting CUNY\'s proficiency standards and preparing for college-level courses.. // For incoming students who haven\'t passed all their (http://www2.cuny.edu/academics/testing/) CUNY Assessment Tests and need to meet CUNYs proficiency standards, CUNY Start offers affordable help in reading, writing, and math.', 'http://www2.cuny.edu/admissions/undergraduate/', 'Email CUNY Start at your campusBorough o', '', '', 'Costs $75, including materialsStudents can choose between full-time and part-time schedulesA second program option, (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/math-start/) Math Start (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/foster-care-initiative/) , helps students develop math skills in just 8 weeksFoster youth can get additional services through the Foster Care Initiative. // You might be eligible for CUNY Start if you can answer yes to these questions:Have you earned a high school or high school equivalency diploma?Have you been admitted to (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/campus-info/) CUNY (http://www.cuny.edu/academics/testing.html) ?Have you received results on the (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/campus-info/) CUNY Assessment Test showing you need more help in reading, writing, or math?Are you a first-time freshman or an enrolled student with limited credits?Specific colleges may have other eligibility criteria. Contact the CUNY Start program at your campus for more information.. // To enroll in CUNY Start:Complete all (http://www2.cuny.edu/admissions/undergraduate/) CUNY admissions (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/campus-info/) requirements and apply to a (http://www.cuny.edu/academics/testing.html) CUNY Start campus (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/campus-info/) Take the CUNY Assessment Tests and check your scores to see if you need extra helpGo to an information session at one of the CUNY Start campusesComplete the online program applicationInterview with a CUNY Start staff memberSubmit a copy of your high school or high school equivalency diploma and complete any other requirements for your collegePay your $75 student fee. // To enroll in CUNY Start:Complete all (http://www2.cuny.edu/admissions/undergraduate/) CUNY admissions (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/campus-info/) requirements and apply to a (http://www.cuny.edu/academics/testing.html) CUNY Start campus (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/campus-info/) Take the CUNY Assessment Tests and check your scores to see if you need extra helpGo to an information session at one of the CUNY Start campusesComplete the online program applicationInterview with a CUNY Start staff memberSubmit a copy of your high school or high school equivalency diploma and complete any other requirements for your collegePay your $75 student fee. // Start your application. // http://www2.cuny.edu/admissions/undergraduate/. // . // . // . // . // . // . // . // . // Contact CUNY Start at your campus todayBorough of Manhattan Community Collegecunystart@bmcc.cuny.edu (mailto:cunystart@bmcc.cuny.edu) 646-346-8398 (mailto:cunystart@bcc.cuny.edu) Bronx Community Collegecunystart@bcc.cuny.edu (mailto:cunystart@csi.cuny.edu) 718-289-5100 (mailto:cunystart@hostos.cuny.edu) ext. 3141College of Staten Islandcunystart@csi.cuny.edu (mailto:cunystart@kbcc.cuny.edu) 718-982-3069 (mailto:cunystart@lagcc.cuny.edu) Hostos Community Collegecunystart@hostos.cuny.edu (mailto:cunystart@mec.cuny.edu) 718-518-6851 (mailto:cunystart@qcc.cuny.edu) Kingsborough Community Collegecunystart@kbcc.cuny.edu (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/about-cuny-start/) 718-368-4500LaGuardia Community Collegecunystart@lagcc.cuny.edu718-482-5137Medgar Evers Collegecunystart@mec.cuny.edu718-270-6161Queensborough Community Collegecunystart@qcc.cuny.edu718-281-5368Get more information on the CUNY Start website. // . // Visit the websiteGet more information on the (http://www2.cuny.edu/academics/academic-programs/model-programs/cuny-college-transition-programs/cuny-start/about-cuny-start/) CUNY Start website.. // Email CUNY Start at your campusBorough of Manhattan Community College (mailto:cunystart@bmcc.cuny.edu) Bronx Community College (mailto:cunystart@bcc.cuny.edu) College of Staten Island (mailto:cunystart@csi.cuny.edu) Hostos Community College (mailto:cunystart@hostos.cuny.edu) LaGuardia Community College (mailto:cunystart@lagcc.cuny.edu) Medgar Evers College (mailto:cunystart@mec.cuny.edu) Queensborough Community College (mailto:cunystart@qcc.cuny.edu). // Call CUNY Start at your campus todayBorough of Manhattan Community College: 646-346-8398Bronx Community College: 718-289-5100 ext. 3141College of Staten Island: 718-982-3069Hostos Community College: 718-518-6851Kingsborough Community College: 718-368-4500LaGuardia Community College: 718-482-5137Medgar Evers College: 718-270-6161Queensborough Community College: 718-281-5368. //', '', '', '', ''),
('1001', '255', '', 'LGBTQ Health Care Services', '', 'LGBTQ Health Care. // Safe and affirming health care for LGBTQ New Yorkers.. // LGBTQ New Yorkers can get quality health care in safe and respectful NYC Health + Hospitals centers. Services include:womens and men\'s healthtransgender health, including gender affirming surgeries and hormone therapyHIV and STD prevention, screening, and treatmentsocial work and behavioral health servicesprimary careAll staff are trained on physical, psychological, and social LGBTQ issues.', '', 'NYC Health + HospitalsEmail NYC Health +', '', '', 'Care is provided to everyone, regardless of your ability to pay or immigration statusNYC Health + Hospitals can help you find insurance if you need itYou\'re free to use the restroom or single sex area that is most aligned with your gender identity or expressionYouth twelve and older can get private reproductive and sexual health services. // All New Yorkers can get help at an NYC Health + Hospitals facility, regardless of your ability to pay or immigration status.. // To make an appointment, call NYC Health + Hospitals at 212-423-7292 (mailto:metlgbt@nychhc.org) or send them an email.. // To make an appointment, call NYC Health + Hospitals at 212-423-7292 (mailto:metlgbt@nychhc.org) or send them an email.. // . // . // . // . // . // . // . // . // . // . // Visit the NYC Health + Hospitals LGBTQ Health website (http://www.nychealthandhospitals.org/services/lgbtq-health-care-services/) to learn more.Email NYC Health + Hospitals (mailto:lgbtq@nychhc.org) for more information on LGBTQ health care services.Call NYC Health + Hospitals at 212-423-7292 to make an appointment.. // . // Visit the websiteVisit the NYC Health + Hospitals LGBTQ Health website (http://www.nychealthandhospitals.org/services/lgbtq-health-care-services/) to learn more.. // NYC Health + HospitalsEmail NYC Health + Hospitals (mailto:lgbtq@nychhc.org) for more information on LGBTQ health care services.. // Call for an appointmentCall NYC Health + Hospitals at 212-423-7292 to make an appointment.. //', '', '', '', ''),
('1002', '254', '', 'Accelerated Study in Associate Programs', '', 'Help earning your CUNY degree. // CUNY students can get financial, academic, and personal support to help them complete their associate degree.. // CUNY ASAP helps students earn an associate degree within three years by providing financial, academic, and personal support. Benefits include an ASAP advisor, career development support, tuition help for students on financial aid, and more. The program is available at (http://www1.cuny.edu/sites/asap/join-asap/#join-us) nine CUNY colleges in all five boroughs.', 'http://www2.cuny.edu/admissions/', '', '', '', 'Other program benefits include free unlimited Metrocard, help with textbook costs, and special registration optionsFor students interested in earning a bachelors degree, the program (http://www.jjay.cuny.edu/ace-john-jay) ACE (Accelerate, Complete, Engage) (https://gcc02.safelinks.protection.outlook.com/?url=http%3A%2F%2Fwww.jjay.cuny.edu%2Face-john-jay&data=02%7C01%7Clkerry%40nycopportunity.nyc.gov%7C4e6c4b96734b410eab0b08d727fa3e38%7C73d61799c28440228d4154cc4f1929ef%7C0%7C0%7C637021828077660729&sdata=ms8W6GhjsWw%2BjzPaoQ7XxUKflmkqGdek3daUR3IiDLA%3D&reserved=0) offers the same benefits as ASAP and is available to students at John Jay College of Criminal Justice (https://gcc02.safelinks.protection.outlook.com/?url=http%3A%2F%2Flehman.edu%2Face%2F&data=02%7C01%7Clkerry%40nycopportunity.nyc.gov%7C4e6c4b96734b410eab0b08d727fa3e38%7C73d61799c28440228d4154cc4f1929ef%7C0%7C0%7C637021828077670724&sdata=ibiIsMKQhLAymz5TP1%2BFVNBjz789zg0Dg%2FBGGtXDB7Q%3D&reserved=0) and Lehman College. // You may be eligible for ASAP if you answer \"yes\" to all of the following questions:Have you applied and been accepted to a (http://www1.cuny.edu/sites/asap/join-asap/) CUNY college that offers (http://www1.cuny.edu/sites/asap/join-asap/) (http://www2.cuny.edu/about/administration/offices/legal-affairs/university-tuition-fee-manual/iv-residency/) ASAP (http://www1.cuny.edu/sites/asap/asap-eligible-majors-by-campus/) ?Are you a New York City resident or (http://www2.cuny.edu/academics/testing/testing-faqs/) eligible for in-state tuition?Do you agree to enter into a full-time associate degree program (minimum of 12 credits per semester) in an ASAP-approved major?Based on CUNY Assessment Test scores, are you skills-proficient in reading, writing, and math? Or, do you have no need for more than two remedial courses in these subjects?If you\'re a continuing or transfer student, do you have no more than 15 college credits and a minimum GPA of 2.0?. // To join ASAP, follow these easy steps: (http://www1.cuny.edu/sites/asap/how-to-apply/) Apply to a CUNY college (http://www.fafsa.gov/) that has ASAPComplete the Free Application for Federal Student Aid (FAFSA (http://www.hesc.ny.gov/) ) and the New York State Tuition Assistance Program (TAP) application (http://www2.cuny.edu/academics/testing/) Accept your offer of admissionComplete all admissions requirements for your college, including the (http://www1.cuny.edu/sites/asap/contact/) CUNY Assessment Tests (http://www.fafsa.gov) if necessary (http://www.hesc.ny.gov) Check your college\'s ASAP website (http://www2.cuny.edu/financial-aid/federal-and-state-grants/) for information on additional needs and next stepsNote: To join ASAP, students must complete the FAFSA and New York State TAP application each year and accept any federal and state grant aid awarded (Pell, SEOG, TAP).. // To join ASAP, follow these easy steps: (http://www1.cuny.edu/sites/asap/how-to-apply/) Apply to a CUNY college (http://www.fafsa.gov/) that has ASAPComplete the Free Application for Federal Student Aid (FAFSA (http://www.hesc.ny.gov/) ) and the New York State Tuition Assistance Program (TAP) application (http://www2.cuny.edu/academics/testing/) Accept your offer of admissionComplete all admissions requirements for your college, including the (http://www1.cuny.edu/sites/asap/contact/) CUNY Assessment Tests (http://www.fafsa.gov) if necessary (http://www.hesc.ny.gov) Check your college\'s ASAP website (http://www2.cuny.edu/financial-aid/federal-and-state-grants/) for information on additional needs and next stepsNote: To join ASAP, students must complete the FAFSA and New York State TAP application each year and accept any federal and state grant aid awarded (Pell, SEOG, TAP).. // Apply to CUNY. // http://www2.cuny.edu/admissions/. // . // . // . // . // . // . // . // . // Visit the (http://www1.cuny.edu/sites/asap/) CUNY ASAP website (http://www2.cuny.edu/admissions/undergraduate/welcomecenter/) to learn more about the programDrop by the CUNY Welcome Center for help with your CUNY application and to learn more about other CUNY programs:217 E. 42nd St.New York, NY 1001. // Visit the Welcome CenterDrop by the (http://www2.cuny.edu/admissions/undergraduate/welcomecenter/) CUNY Welcome Center for help with your CUNY application and to learn more about other CUNY programs:217 E. 42nd St.New York, NY 1001. // Visit the websiteVisit the (http://www1.cuny.edu/sites/asap/) CUNY ASAP website to learn more about the program.. // . // . //', '', '', '', ''),
('1003', '255', '', 'NYC YouthHealth', '', 'Health services for youth. // If you are 12 and over and looking for health care, NYC Health + Hospitals has your back.. // Youth can get care at NYC Health + Hospitals clinics. Services include:sexual and reproductive health careprimary caremental health and depression helpLGBTQ carehealthy weight managementsports physical and sports injury careCare is open to all youth, regardless of ability to pay, immigration status, disability, sexual orientation, or gender identity/expression.', 'http://www.nycyouthhealth.org/html/find-youth-services.shtml', '', '', '', 'All sexual and reproductive services are private. Staff will not speak to anyone about them, not even your parents or guardians, without your permissionYou do not need an appointment for emergency contraception, pregnancy testing, or STI/D testing - you can just walk into clinics. // All NYC youth, regardless of ability to pay, immigration status, or sexual orientation, disability, sexual orientation, or gender identity are eligible for care at YouthHealth clinics.. // YouthHealth clinics are located across NYC. Use the location finder (http://www.nycyouthhealth.org/html/find-youth-services.shtml) to find a clinic close to you and call to make an appointment.. // YouthHealth clinics are located across NYC. Use the location finder (http://www.nycyouthhealth.org/html/find-youth-services.shtml) to find a clinic close to you and call to make an appointment.. // Find a YouthHealth Clinic. // http://www.nycyouthhealth.org/html/find-youth-services.shtml. // . // . // . // . // . // . // . // . // Visit the YouthHealth website (http://www.nycyouthhealth.org/html/index.shtml) to learn more.Find a YouthHealth clinic near you (http://www.nycyouthhealth.org/html/find-youth-services.shtml) to get help in person or by phone.. // Visit a YouthHealth clinicFind a YouthHealth clinic near you (http://www.nycyouthhealth.org/html/find-youth-services.shtml) to get help in person.. // . // . // . //', '', '', '', ''),
('1004', '234', '', 'High School', '', 'Public school: grades 9 - 12. // Learn about the High School Admissions process for public schools.. // There are more than 700 programs at over 400 public high schools in NYC. Eighth graders and first-time 9th graders have the chance to apply for 12 programs during the high school admissions process.', 'https://www.myschools.nyc', 'Email your questionsEmail the High Schoo', '', '', 'Students interested in Specialized High Schools (https://www.schools.nyc.gov/enrollment/enroll-grade-by-grade/specialized-high-schools) should audition or sign up to take an admissions test in OctoberStudents with disabilities and English Language Learners (ELL) may apply to any high school programThe high school action checklist (https://www.schools.nyc.gov/docs/default-source/default-document-library/hs-action-checklist---english-accessible) can help keep you on track with key dates. // To be eligible to apply for a NYC public high school, you should be able to answer yes to these questions:Are you a NYC resident?Are you currently an eighth grade student or a first-time ninth grade student?. // To apply for admission to a public high school:Visit (http://app.bronto.com/t/l?ssid=4776&subscriber_id=bpoodwbawwvylbzfifslbjpsdmkzbbm&delivery_id=avrbhhzshlfzjwfwzeuqyufrirybbce&td=9yWbDVN0mB36O2cIzTouCQWrpk6bgx7E5xawCisi_rGgRpKUAlMuXHuiyHL09YDwRPvln_RxgubkRx7nPCNs-HHRyofj3L_p2cgoav4uaepYFKN0UTar4AP8bN6gCQkjdf32t8TAQyQYLMTtLnWEza00fLixDyBde76VmBxPDc4aMW8F1Lm8eH4Akf8gHRf-o2oVusiA5k6OGHoXWDSYADOP_TvpVZ7DwrEqi6D7HOZJNdYgYyiA8NEg) MySchools. (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) and set up your account. You\'ll need an account creation code, which will come in a Welcome Letter mailed to your home or available to pick up at a Family Welcome Center (http://app.bronto.com/t/l?ssid=4776&subscriber_id=bpoodwbawwvylbzfifslbjpsdmkzbbm&delivery_id=avrbhhzshlfzjwfwzeuqyufrirybbce&td=9yWbDVN0mB36O2cIzTouCQWrpk6bgx7E5xawCisi_rGgRpKUAlMuXHuiyHL09YDwRPvln_RxgubkRx7nPCNs-HHRyofj3L_p2cgoav4uaepYFKN0UTar4AP8bN6gCQkjdf32t8TAQyQYLMTtLnWEza00fLixDyBde76VmBxPDc4aMW8F1Lm8eH4Akf8gHRf-o2oVusiA5k6OGHoXWDSYADOP_TvpVZ7DwrEqi6D7HOZJNdYgYyiA8NEg) .Use (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) MySchools (https://www.myschools.nyc/en) and talk to your school counselor to explore high school programs based on your interests, location, and more.Select up to 12 choices to add to your application in your true order of preference, and submit it by the deadline.If you just moved to NYC, visit a Family Welcome Center to register.If you want to apply to a specialized high school, register for testing or auditions on MySchools.. // To apply for admission to a public high school:Visit (http://app.bronto.com/t/l?ssid=4776&subscriber_id=bpoodwbawwvylbzfifslbjpsdmkzbbm&delivery_id=avrbhhzshlfzjwfwzeuqyufrirybbce&td=9yWbDVN0mB36O2cIzTouCQWrpk6bgx7E5xawCisi_rGgRpKUAlMuXHuiyHL09YDwRPvln_RxgubkRx7nPCNs-HHRyofj3L_p2cgoav4uaepYFKN0UTar4AP8bN6gCQkjdf32t8TAQyQYLMTtLnWEza00fLixDyBde76VmBxPDc4aMW8F1Lm8eH4Akf8gHRf-o2oVusiA5k6OGHoXWDSYADOP_TvpVZ7DwrEqi6D7HOZJNdYgYyiA8NEg) MySchools. (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) and set up your account. You\'ll need an account creation code, which will come in a Welcome Letter mailed to your home or available to pick up at a Family Welcome Center (http://app.bronto.com/t/l?ssid=4776&subscriber_id=bpoodwbawwvylbzfifslbjpsdmkzbbm&delivery_id=avrbhhzshlfzjwfwzeuqyufrirybbce&td=9yWbDVN0mB36O2cIzTouCQWrpk6bgx7E5xawCisi_rGgRpKUAlMuXHuiyHL09YDwRPvln_RxgubkRx7nPCNs-HHRyofj3L_p2cgoav4uaepYFKN0UTar4AP8bN6gCQkjdf32t8TAQyQYLMTtLnWEza00fLixDyBde76VmBxPDc4aMW8F1Lm8eH4Akf8gHRf-o2oVusiA5k6OGHoXWDSYADOP_TvpVZ7DwrEqi6D7HOZJNdYgYyiA8NEg) .Use (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) MySchools (https://www.myschools.nyc/en) and talk to your school counselor to explore high school programs based on your interests, location, and more.Select up to 12 choices to add to your application in your true order of preference, and submit it by the deadline.If you just moved to NYC, visit a Family Welcome Center to register.If you want to apply to a specialized high school, register for testing or auditions on MySchools.. // Explore your choices. // https://www.myschools.nyc. // . // . // . // . // . // . // . // . // Visit the Department of Education website (http://schools.nyc.gov/ChoicesEnrollment/High/default.htm) to learn more about NYC high schools.See the NYC High School Admissions Guide (https://www.schools.nyc.gov/enrollment/enroll-grade-by-grade/high-school/nyc-high-school-admissions-guide) to find out more information about admissions.Call 718-935-2399 (mailto:HSEnrollment@schools.nyc.gov) or email (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) if you have questions about applying to high school.Visit a Family Welcome Center to get help in person.. // Visit a Family Welcome CenterVisit a Family Welcome Center (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) to get help in person.. // Visit the websiteVisit the Department of Education website (http://schools.nyc.gov/ChoicesEnrollment/High/default.htm) to learn about High School Admissions.. // Email your questionsEmail the High School Admissions team (mailto:HSEnrollment@schools.nyc.gov) with questions about applying.. // Call for helpCall 718-935-2399 if you have questions about applying to high school.. //', '', '', '', ''),
('1005', '235', '', 'Jobs Plus', '', 'Job assistance for public housing residents. // Jobs Plus is an employment program that helps NYCHA residents find employment and increase their earnings.. // Jobs Plus is an employment program for working-age NYCHA residents. It helps participants find work and keep more of their earned income. Jobs Plus offers job-related services, help with finances, and community support.', '', '', '', '', 'Jobs Plus is available at 27 NYCHA developments across 10 sites.Participants can also enroll in the (http://opportunitynycha.org/about-financial-empowerment/rent-incentives/) Earned Income Disallowance (EID) program to prevent rent increases once they find a job or get a raise.. // Jobs Plus is open to all NYCHA residents old enough to work.. // To apply for Jobs Plus, contact a site near you (http://opportunitynycha.org/workforce-development/jobs-plus/) .. // . // . // . // . // . // . // . // . // . // To apply for Jobs Plus, contact a site near you (http://opportunitynycha.org/workforce-development/jobs-plus/) .. // . // Visit the Jobs Plus website (http://opportunitynycha.org/workforce-development/jobs-plus/) to learn more about the program.Call a Jobs Plus site (http://opportunitynycha.org/workforce-development/jobs-plus/) near you for questions about a specific location.. // . // Visit the websiteVisit the Jobs Plus website (http://opportunitynycha.org/workforce-development/jobs-plus/) to learn more about the program.. // . // Call a siteCall a Jobs Plus site (http://opportunitynycha.org/workforce-development/jobs-plus/) for questions about a specific location.. //', '', '', '', ''),
('1006', '234', '', 'Career & Technical Education', '', 'Career training for students. // Students gain hands-on career training while finishing their high school or high school equivalency (HSE) education.. // Career and technical education (CTE) lets students gain career skills as they complete high school or high school equivalency (HSE). CTE offers work-based learning experiences (https://www.schools.nyc.gov/school-life/learning/career-and-technical-education) like job shadowing, mentorships, and internships. Students can also earn a CTE-endorsed Regents Diploma, on top of traditional high school graduation requirements.', 'http://schoolfinder.nyc.gov/', 'Email your question Email the Office of ', '', '', 'CTE is available at designated CTE high schools (http://cte.nyc/site/content/cte-schools-and-program-directory) and through CTE programs in other high schools17-21 year olds can also take CTE courses at the School of Cooperative and Technical Education (Coop Tech) (http://www.co-optech.org/index.html) 8th graders can enroll in CTE during the regular high school admissions processCoop Tech is open to students getting a HSE diploma and traditional high school diploma. // To be eligible to apply for a NYC public high school, you must be able to answer yes to these questions:Are you a NYC resident?Are you currently an 8th grade student of a first-time 9th grade student?To be eligible for Coop Tech, you must be able to answer yes to these questions:Are you a NYC resident?Are you 17-21 years old?Are you either in 11 or 12th grade, a District 79 program, or have already graduated high school?If you are still a student, have you earned at least 20 credits?. // To apply for admission to CTE at a public high school:Get a paper application from your middle school guidance counselor or at a Family Welcome Center (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) .Use the NYC School Finder (http://schoolfinder.nyc.gov/) to find high schools based on where you live and your interests.Select up to 12 high schools in the order you\'d like to attend.Give your completed application to your guidance counselor by December 1st.To apply for admissions at Coop Tech, complete the application (http://www.co-optech.org/PDFs/Application.pdf) and follow the directions listed. // To apply for admission to CTE at a public high school:Get a paper application from your middle school guidance counselor or at a Family Welcome Center (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) .Use the NYC School Finder (http://schoolfinder.nyc.gov/) to find high schools based on where you live and your interests.Select up to 12 high schools in the order you\'d like to attend.Give your completed application to your guidance counselor by December 1st.To apply for admissions at Coop Tech, complete the application (http://www.co-optech.org/PDFs/Application.pdf) and follow the directions listed.. // Find a CTE program. // http://schoolfinder.nyc.gov/. // . // . // . // . // . // . // . // . // Visit the CTE (http://cte.nyc/) or Department of Education (https://www.schools.nyc.gov/school-life/learning/career-and-technical-education) website to learn more about CTE.Visit the Coop Tech website (http://www.co-optech.org/) to learn more about their programs.Call the high school admission line at 718-935-2399 (mailto:CTENYC@schools.nyc.gov) or email (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) if you have questions about CTE.Visit a Family Welcome Center to get help in person.. // Visit a Family Welcome Center Visit a Family Welcome Center (https://www.schools.nyc.gov/enrollment/enrollment-help/family-welcome-centers) to get help in person.. // Visit the websitesVisit the CTE (http://cte.nyc/) or Department of Education (https://www.schools.nyc.gov/school-life/learning/career-and-technical-education) website to learn more about CTE. Visit the Coop Tech website (http://www.co-optech.org/) to learn more about their programs.. // Email your question Email the Office of School Enrollment (mailto:HS_Enrollment@schools.nyc.gov) if you have questions about CTE.. // Call high school admission Call the high school admission line at 718-935-2399 if you have questions about applying.. //', '', '', '', ''),
('1007', '256', '', 'NYC Family Justice Centers', '', 'Help for survivors of gender-based violence. // Services are available in all boroughs for survivors of domestic and gender-based violence.. // Survivors of sexual violence, human trafficking, stalking, and intimate partner and family violence can get free and confidential services at NYC FJCs, including:Counseling for adults and children, and mental health services for adultsHelp with safety planning, housing, shelter, and other needsLegal help with orders of protection, custody, visitation, divorce, immigration, and housing mattersHelp filing police reportsFinancial services, job training, and education program referrals', '', '', '', '', 'Call the NYC Domestic Violence and Sexual Assault Hotline at 800-621-4673 (HOPE), TTY: 866-604-5350 (if you are hearing impaired), or call 311 and ask for the hotlineCall 911 if you are in danger and need immediate helpYou don\'t need to make an appointment to visit any NYC Family Justice CenterServices are free, confidential, and most are available at one locationStaff speak more than 30 languages and interpreters are available at every FJCChild care for ages three and up is available while you are receiving services on-site. // Services are free and confidential. People of any ages, income, sexual orientation, gender identity, immigration status or language spoken are welcome.. // . // . // . // . // . // . // . // . // . // . // . // . // Visit the Mayor\'s Office to End Domestic and Gender-Based Violence website (http://www.nyc.gov/nycfjc) to learn more about NYC FJCs and other services for survivors of domestic and gender-based violence.Call the NYC Domestic Violence and Sexual Assault Hotline at 800-621-4673 (HOPE) or TTY:&nbsp;866-604-5350 (if you are hearing impaired), or call 311 and ask for the hotline.Call 911 for emergencies.Call or visit any Family Justice Center:Bronx: 198 East 161st St, 2nd Floor, Bronx, NY Call: 718-508-1220Brooklyn: 350 Jay St, 15th Floor, Brooklyn, NY Call: 718-250-5111Manhattan: 80 Centre St, 5th Floor, New York, NY Call: 212-602-2800Queens: 126-02 82nd Ave, Kew Gardens, NY Call: 718-575-4545Staten Island: 126 Stuyvesant Pl, Staten Island, NY Call: 718-697-4300. // Visit a Family Justice CenterFind a (https://access.nyc.gov/locations/?programs=6905) Family Justice Center in your borough to get connected to services and support.. // Visit the websiteVisit the Mayor\'s Office to End Domestic and Gender-Based Violence website (http://www.nyc.gov/nycfjc) to learn more about NYC FJCs and other services for survivors of domestic and gender-based violence.. // . // Call the hotlineCall the NYC Domestic Violence and Sexual Assault Hotline at 800-621-4673 (HOPE), TTY 866-604-5350 (if you are hearing impaired) to speak with a counselor.. // Call 311Ask for the Domestic Violence Hotline.Call 911 if you are in danger and need immediate help.', '', '', '', ''),
('1008', '239', '', 'Summer Youth Employment Program', '', 'Paid summer experiences for youth. // SYEP provides youth between the ages of 14 and 24 with paid summer experiences for up to six weeks.. // If you are between the ages of 14 and 24, you can get a paid summer experience through SYEP. There are jobs in government, museums, sports, and more. For more help, SYEP leads workshops on finding a job and understanding your finances.', 'https://application.nycsyep.com/', '', '', '', 'Apply to SYEP (https://application.nycsyep.com/) online during the application period. The application for SYEP will only be available during that time.Selection is based on a lottery.Apply in the the spring each year.Apply online or at a community-based organization during the application period.Work is available for youth with disabilities.. // You may be eligible if you can answer yes to these questions.Do you live in NYC?Are you between 14 and 24 years old?. // Apply to SYEP (https://application.nycsyep.com/) online (https://application.nycsyep.com/Images/SYEP_2019_Participant_Application_YY.pdf) during the application period. The application for SYEP will only be available during that time.Youth can also submit paper applications for (https://application.nycsyep.com/Images/SYEP_2019_Participant_Application_OY.pdf) 14-15 year olds or 16-24 year olds at a SYEP provider listed on the application.Participants are selected by lottery for the program.. // Apply to SYEP (https://application.nycsyep.com/) online during the application period. The application for SYEP will only be available during that time.Participants are selected by lottery for the program.. // Apply online. // https://application.nycsyep.com/. // . // . // . // Youth can also submit paper applications for (https://application.nycsyep.com/Images/SYEP_2019_Participant_Application_YY.pdf) 14-15 year olds (https://application.nycsyep.com/Images/SYEP_2019_Participant_Application_OY.pdf) or 16-24 year olds at a SYEP provider listed on the application.. // Find a Community Organization. // https://access.nyc.gov/locations/?&programs=6885. // . // If selected for work, the following documents will need to be provided:Proof of identityProof of addressProof of incomeEligibility to work (working papers)Youth can get their working papers from their school.. // Visit the SYEP page (http://www1.nyc.gov/site/dycd/services/jobs-internships/summer-youth-employment-program-syep.page) on the DYCD website to learn more.Call DYCD Youth Connect at 800-246-4646 or 646-343-6800 for more information.. // . // Visit the websiteVisit the SYEP page (http://www1.nyc.gov/site/dycd/services/jobs-internships/summer-youth-employment-program-syep.page) on the DYCD website to learn more.. // . // Call SYEPCall DYCD Youth Connect at 800-246-4646 or 646-343-6800 for more information.. // Call 311Ask for Summer Youth Employment Program assistance.', '', '', '', ''),
('1009', '239', '', 'Train & Earn', '', 'Job prep for youth not working or in school. // Train & Earn offers job training and job placement help to unemployed youth who are not in school.. // Train & Earn is a short-term career pathway program for low-income youth, who are not working and not in school. Train & Earn helps youth improve their job skills and find permanent work. It also provides High School Equivalency (HSE) prep and support services.Youth receive up to 12 months of follow-up services after finishing the program.', 'https://discoverdycd.dycdconnect.nyc', '', '', '', 'Available for youth 16 - 24 years old, who are not working and not in schoolCollege placement, HSE prep, and support services are also availableEnroll at different times throughout the year. // To be eligible for Train & Earn, you should be able to answer \'yes\' to these questions:Are you a resident of NYC?Are you 16 24 years old?Are you not attending school and not working?Do you meet one of these requirements:You are a homeless or runaway youthYou are a foster care youth or have aged out of foster care systemYou are in involved in the justice systemYou are a youth with a disabilityYou are pregnant or a parentYou are low-income and need additional help to enter or complete an education program or to get or hold a jobIf you have additional questions about eligibility, call DYCD Youth Connect at 800-246-4646.. // You can use Discover DYCD to find programs in your area. To get started:Go to the Discover DYCD (https://discoverdycd.dycdconnect.nyc/) websiteType \"Train & Earn\" into the \"Keyword Search\" boxFind programs in your area by entering your zip code, neighborhood, or borough, and clicking \"Search\". // You can use Discover DYCD to find programs in your area. To get started:Go to the Discover DYCD (https://discoverdycd.dycdconnect.nyc/) websiteType \"Train & Earn\" into the \"Keyword Search\" boxFind programs in your area by entering your zip code, neighborhood, or borough, and clicking \"Search\". // Search for a program. // https://discoverdycd.dycdconnect.nyc. // . // . // . // . // . // . // . // . // Call DYCD Youth Connect at 800-246-4646 (https://www1.nyc.gov/site/dycd/services/jobs-internships/train-and-earn.page) if you have questions about this program.Visit the DYCD website for more information.. // . // Visit the websiteVisit the DYCD website (https://www1.nyc.gov/site/dycd/services/jobs-internships/train-and-earn.page) for more information.. // . // Call Youth ConnectCall DYCD Youth Connect at 800-246-4646 if you have questions about this program.. //', '', '', '', ''),
('1010', '239', '', 'Intern & Earn (formerly the Young Adult Internship Program)', '', 'Internships for young adults. // Intern & Earn is a 14-week paid internship program for youth ages 16 - 24 who are not working and not in school.. // Intern & Earn (formerly the Young Adult Internship Program) helps 16 - 24 year olds who are not working and not in school get short-term paid internships. Youth participate in 14 weeks of internships and work-readiness workshops. Youth also get help with job placement or enrollment in school or a job training program for up to nine months after the program.', 'https://discoverdycd.dycdconnect.nyc/', '', '', '', 'Programs are free and available to youth ages 16 - 24 who are not in school and not workingEnrollment is at different times throughout the yearJob placement is available in many industries, including construction, hospitality, healthcare, and retail. // To be eligible for Intern & Earn, you should be able to answer yes to these questions.Are you 16 - 24 years old?Are you currently not enrolled in school, and not working?Did you not have an associate\'s or bachelor\'s degree?. // You can use Discover DYCD to find programs in your area. To get started:Go to the Discover DYCD (https://discoverdycd.dycdconnect.nyc/programme-public) website.Type \"Intern & Earn\" in the \"Keyword Search\" boxFind programs in your area by entering your zip code, neighborhood, or borough, and clicking \"Search\". // You can use Discover DYCD to find programs in your area. To get started:Go to the Discover DYCD (https://discoverdycd.dycdconnect.nyc/programme-public) website.Type \"Intern & Earn\" in the \"Keyword Search\" boxFind programs in your area by entering your zip code, neighborhood, or borough, and clicking \"Search\". // Find a program. // https://discoverdycd.dycdconnect.nyc/. // . // . // . // . // . // . // . // . // Call DYCD Youth Connect at 800-246-4646 (https://www1.nyc.gov/site/dycd/services/jobs-internships/young-adult-internship-program-yaip.page) if you have questions about this program.Visit the DYCD website for more information.. // Visit the website Visit the DYCD website (https://www1.nyc.gov/site/dycd/services/jobs-internships/young-adult-internship-program-yaip.page) for more information.. // . // . // Call Youth Connect Call DYCD Youth Connect at 800-246-4646 if you have questions about this program.. //', '', '', '', ''),
('1011', '234', '', 'Summer Meals', '', 'Breakfast & lunch in the summer. // Children can get free breakfast and lunch in the summer at hundreds of locations in NYC.. // During the summer, children can get free breakfast and lunch. Locations include schools, libraries, community pools, and NYCHA buildings. There are also food trucks at some beaches, parks, and playgrounds.', '', '', '', '', 'No registration, documentation, or ID is required to receive a free breakfast or lunch mealFor children 18 and underFind Free Summer Meals locations (http://www.schoolfoodnyc.org/sch_search/summerNew.aspx). // All NYC children, 18 and under, can get free meals in the summer.. // There is no registration required to enjoy free breakfast or lunch. Children 18 years and younger just need to walk in to one of the many community locations (http://www.schoolfoodnyc.org/sch_search/summerNew.aspx) .. // . // . // . // . // . // . // . // . // . // . // . // Find Free Summer Meals locations (http://www.schoolfoodnyc.org/sch_search/summerNew.aspx) Visit the Summer Meals website (https://www.schools.nyc.gov/school-life/food/summer-meals) to find out moreCall the Schoolfood Summer meals team at 718-707-4398 or School Foods Help Desk at 877-363-6325 if you have questions. // . // Visit the websiteVisit the Summer Meals website (https://www.schools.nyc.gov/school-life/food/summer-meals) to find out more.. // . // Call the help deskCall the Schoolfood Summer meals team at 718-707-4398 or School Foods Help Desk at 877-363-6325 if you have questions.. // Call 311Ask for Summer Meals assistance.', '', '', '', ''),
('1012', '238', '', 'Office of Child Support Services', '', 'Child Support Services. // Financial support for children and employment support for fathers and mothers.. // The program helps mothers, fathers, and guardians with child support. People who receive child support can get help collecting it. People who pay child support can get help finding a job and managing their child support debt. Other services are also available.', '', '', '', '', 'You dont have to be a citizen to get this service, and you won\'t be asked about your immigration statusThis program doesnt help with custody or visitation. It can guide you to resources for these services, such as mediationYou should get a child support order even if you think the other parent cant afford to pay right now. They can get help finding work and may qualify for financial protectionsA child can get child support until age 21, even if the other parent isnt involved in the childs lifeParents whose cash assistance was lowered because they did not participate correctly with child support can have it raised when they begin to comply. These parents should bring the necessary documentation to their (https://access.nyc.gov/locations/?programs=15014) child support officeChild support has proven to benefit kids in many ways, especially when it comes to doing well in schoolNoncustodial parents who are unemployed or underemployed can get connected to job services.Parents who are behind on their child support payments may qualify for a program to lower their debt.. // To be eligible for child support services, you should be able to answer yes to these questions:Are you a parent or legal guardian of a child under the age of 21?Are you primarily responsible for the childs day-to-day life?. // (https://access.nyc.gov/wp-content/uploads/2018/08/Child_Support_Enforcement_Form_EN.pdf) Download and complete the child support application (https://access.nyc.gov/locations/?programs=15014) . You only need to fill out the last 8 pages.Submit the application to your local (http://www.nycourts.gov/courts/nyc/family/index.shtml) child support office (https://www1.nyc.gov/assets/hra/downloads/pdf/services/child_support/STEP/Eng-Span%20STEP%20Brochure%20%20Final%205-25-16.pdf) at the Family Court (https://www1.nyc.gov/assets/hra/downloads/pdf/services/child_support/manage_your_child_support.pdf) in your borough.If youre applying for or receiving cash assistance or medical assistance, you need to interview at the Office of Child Support Services to open a case.Bring as much information as you can about the childs other parent. Examples include their birthday, Social Security number, address, and employers name. A photo is also helpful.If you\'re a noncustodial parent looking for work, read more about the (https://www1.nyc.gov/assets/hra/downloads/pdf/services/child_support/ApplicationDebtReduction.pdf) Support Through Employment Program (STEP) (https://www1.nyc.gov/assets/hra/downloads/pdf/services/child_support/Arrears_Credit_Program_Agreement.pdf) .If you\'re a noncustodial parent with child support debt, learn your options to lower it with the Manage Your Child Support brochure. After, fill out the Arrears Cap Program application or Arrears Credit Program application.. // . // . // . // . // Download the form. // https://access.nyc.gov/wp-content/uploads/2018/08/Child_Support_Enforcement_Form_EN.pdf. // (https://access.nyc.gov/wp-content/uploads/2018/08/Child_Support_Enforcement_Form_EN.pdf) Download and complete the child support application (https://access.nyc.gov/locations/?programs=15014) . You only need to fill out the last 8 pages.Submit the application to your local (http://www.nycourts.gov/courts/nyc/family/index.shtml) child support office (https://www1.nyc.gov/assets/hra/downloads/pdf/services/child_support/STEP/Eng-Span%20STEP%20Brochure%20%20Final%205-25-16.pdf) at the Family Court (https://www1.nyc.gov/assets/hra/downloads/pdf/services/child_support/manage_your_child_support.pdf) in your borough.If youre applying for or receiving cash assistance or medical assistance, you need to interview at the Office of Child Support Services to open a case.Bring as much information as you can about the childs other parent. Examples include their birthday, Social Security number, address, and employers name. A photo is also helpful.If you\'re a noncustodial parent looking for work, read more about the (https://www1.nyc.gov/assets/hra/downloads/pdf/services/child_support/ApplicationDebtReduction.pdf) Support Through Employment Program (STEP) (https://www1.nyc.gov/assets/hra/downloads/pdf/services/child_support/Arrears_Credit_Program_Agreement.pdf) .If you\'re a noncustodial parent with child support debt, learn your options to lower it with the Manage Your Child Support brochure. After, fill out the Arrears Cap Program application or Arrears Credit Program application.. // Visit an office. // https://access.nyc.gov/locations/?programs=15014. // . // When you go to your interview, youll need to bring the following documents:Your completed applicationYour childs birth certificateThe Acknowledgement of Paternity (https://www.childsupport.ny.gov/dcse/pdfs/4418.pdf) (AOP) or an Order of Filiation (https://www.nycourts.gov/courthelp/family/paternityOrder.shtml) from Family CourtA recent photo of the other parent. // Visit the Child Support Services (http://www1.nyc.gov/site/hra/help/child-support-services.page) website to learn more about available services.Visit the (https://access.nyc.gov/locations/?programs=15014) child support office (http://www.nycourts.gov/courts/nyc/family/index.shtml) at the Family Court in your borough to get help in person.If you already have a child support order, visit the child support walk-in center for help. 151 West Broadway, 4th Fl. New York, NY 10013 Open Monday - Friday, 8:00 a.m - 7:00 p.m.Photo ID requiredIf you have questions about child support, write to the Office of Child Support Services. PO Box 830 Canal Street Station New York, NY 10013For more information, call the Child Support Helpline at 888-208-4485 (or 866-875-9975 if you have trouble hearing).. // Visit the walk-in center151 West Broadway, 4th Fl. New York, NY 10013 Open Monday - Friday, 8:00 a.m. - 7:00 p.m.Photo ID required. // Visit the websiteVisit the Child Support Services website (https://www1.nyc.gov/site/hra/help/child-support-services.page) to learn more about available services.Visit the Noncustodial Parents page (https://www1.nyc.gov/site/hra/help/noncustodial-parents.page) for services available to noncustodial parents, such as work and lowering debt.. // . // Call the HelplineCall NYS Child Support Helpline at 888-208-4485 (or 866-875-9975 if you have trouble hearing) for more information. Automated information is available 24 hours a day/7 days a week. Social security number and PIN required.. // Call 311Ask for Child Support.', '', '', '', ''),
('1013', '239', '', 'School\'s Out NYC', '', 'After school for middle schoolers. // SONYC offers a mix of activities, including leadership, Science Technology Engineering and Math (STEM), literacy, academic help, sports, arts, and more.. // SONYC is an after school program for students in grades 6, 7, and 8. SONYC activities include dance, music, sports, fashion, cooking, and more.', 'https://discoverdycd.dycdconnect.nyc', '', '', '', 'Young people can take part in programs for freePrograms take place three hours each day, five days per week. // All NYC students, in 6th, 7th, and 8th grade, are eligible to enroll in SONYC programs.. // You can use Discover DYCD to find programs in your area. To get started:Go to the Discover DYCD (https://discoverdycd.dycdconnect.nyc/programme-public) websiteType \"Schools Out New York City (SONYC)\" into the \"Keyword Search\" boxFind programs in your area by entering your zip code, neighborhood, or borough, and clicking \"Search\"You can also enroll your child in a SONYC program by contacting the program staff at your childs school.. // You can use Discover DYCD to find programs in your area. To get started:Go to the Discover DYCD (https://discoverdycd.dycdconnect.nyc/programme-public) websiteType \"Schools Out New York City (SONYC)\" into the \"Keyword Search\" boxFind programs in your area by entering your zip code, neighborhood, or borough, and clicking \"Search\"You can also enroll your child in a SONYC program by contacting the program staff at your childs school.. // Search online. // https://discoverdycd.dycdconnect.nyc. // . // . // . // You can enroll your child in a SONYC program by contacting the program staff at your childs school.. // . // . // . // . // Visit the (https://www1.nyc.gov/site/dycd/services/after-school/schools-out-new-york-city-sonyc.page) SONYC website to learn moreCall DYCD Youth Connect at 800-246-4646 for more informationCall or visit the after school program staff at your child\'s school for more information. // Visit your child\'s schoolSpeak with an after school program staff at your child\'s school for more information.. // Visit the websitesVisit the (https://www1.nyc.gov/site/dycd/services/after-school/schools-out-new-york-city-sonyc.page) SONYC website to learn more.. // . // Call Youth ConnectCall DYCD Youth Connect at 800-246-4646 if you have questions about this program.. //', '', '', '', ''),
('1014', '234', '', 'After School and Saturday Meals', '', 'Meals outside of school hours. // Students can get free food on Saturdays and weekday evenings at some schools.. // Some schools give free meals to students in the evening and on Saturdays. Through this program, children in after school and Saturday programs can get the nutrition they need.', '', '', '', '', '. // Students who live in a school district that provides After School or Saturday meals are eligible to receive free meals.. // Speak to your schools administration or call SchoolFood at 718-707-4320 (http://www.opt-osfns.org/osfns/Resources/SpecialPrograms/Login.aspx) to find out if your school offers after school or Saturday meal programsCommunity-based organizations (CBOs) and principals should apply for an After school or Saturday Meals program on the Department of Education website. // . // . // . // . // . // . // . // . // . // . // . // Contact SchoolFood at 718-707-4320 (https://www.schools.nyc.gov/school-life/food/food-programs) for questions about the programVisit the SchoolFood website for more information. // . // . // . // . //', '', '', '', '');
